CREATE TABLE t_us_sep(
   "id_us_sep" INTEGER PRIMARY KEY, 
   "num_us_sep" INTEGER, -- UNIQUE -- relation de 1 à 1 avec la clé primaire de t_us 
   "prim_sec" TEXT, -- définit s'il s'agit d'une sépulture primaire ou secondaire
   "reduction" TEXT, -- définit si la sépulture est réduire
   "vidange" TEXT, -- définit s'il y a une vidange
   "position" TEXT, -- position de la vidange ou de la réduction
   "ossuaire" TEXT,
   "pillage" TEXT, -- y a t'il des traces de pillage
   "mobilier" TEXT, -- mobilier attaché au corps
   "commentaire" TEXT
);
SELECT 
