-- squelette
DROP TABLE IF EXISTS t_squelette;
CREATE TABLE t_squelette(
   "id_squel" INTEGER PRIMARY KEY,
   "id_man_squel" INTEGER, -- clé étrangère qui renvoie à la table du mannequin man_squel
   "num_squel" INTEGER UNIQUE, 
   "num_us_sep" INTEGER, -- clé étrangère qui renvoie à la clé primaire "num_us_sep" de la table t_us_sep
   "orientation" TEXT,  -- orientation générale du squelette
   "emplac_tete" TEXT, -- Indiquer l'emplacement de la tête osseuse
   "nom_position" TEXT, --indiquer la disposition du squelette
   "alti_squel" REAL, 
   "pos_av_bras" TEXT, -- Indiquer le degré de fléchissement des avant-bras (le droit en premier, le gauche en second ; 1 est une donnée manquante. Par exemple, 180_180 signifie les bras le long du corps et 45_45 les mains sur l'hémi-thorax opposé)
   "pos_memb_inf" TEXT, -- Indiquer la position générale des membres inférieurs selon la liste 
   "commentaire" TEXT,
   "sex_result_dsp" TEXT, -- Indiquer le sexe de l'individu à partir de la DSP
   "sex_result_mob" TEXT, -- Indiquer le sexe archéologique potentiel du sujet (ceci n'est qu'une proposition en l'absence de toute autre méthode)
   "sex_result_adn" TEXT, -- Indiquer le sexe de l'individu à partir de l'ADN mitochondrial
   "sex_result_calva" TEXT, -- Indiquer le sexe de l'individu à partir de la morphologie des os coxaux
   "sex_result_seupf_d" TEXT, -- Résultat sex estimation using the proximal femur. Indiquer le résultat à partir de la méthode Sexe estimation using proximal femur droit.
   "sex_result_seupf_g" TEXT, -- Résultat sex estimation using the proximal femur. Indiquer le résultat à partir de la méthode Sexe estimation using proximal femur gauche.
   "sex_comment" TEXT,
   "age_methode" TEXT, -- Liste de valeurs.
   "age_class" TEXT, -- Liste de valeurs. Indiquer l'âge du sujet et préciser la méthode à partir de la liste proposée
   "age_comment" TEXT,
   "patho_descrip_gen" TEXT, -- Diagnostic paléopathologique général
   "marq_act_comment" TEXT -- description libre sur les marqueurs d'activités
);

-- la table consernant les OBSERVATIONS réalisées dans le cas d'un SEPULTURE PRIMAIRE
DROP TABLE IF EXISTS t_obs_sep_prim;
CREATE TABLE t_obs_sep_prim(
   "id_obs_prim" INTEGER PRIMARY KEY,
   "num_squel" INTEGER UNIQUE, -- relation de 1 à 1 (création gérée par trigger) avec la table t_squelette où t_squelette.num_squel = t_obs_sep_prim.num_squel
   "env_long" REAL, -- Indiquer la longueur maximale du squelette (cela permet de travailler sur la pression de l'emmaillotement du cadavre ou sur les dimensions d'un contenant). Les données sont en centimètres.
   "env_epaul" REAL, -- Indiquer la largeur du squelette au niveau des épaules (cela permet de travailler sur la pression de l'emmaillotement du cadavre ou sur les dimensions d'un contenant). Les données sont en centimètres.
   "env_bassin" REAL, -- Indiquer la largeur du squelette au niveau des coxaux (cela permet de travailler sur la pression de l'emmaillotement du cadavre ou sur les dimensions d'un contenant). Les données sont en centimètres.
   "env_pieds" REAL, -- Indiquer la largeur du squelette au niveau des os des pieds (cela permet de travailler sur la pression de l'emmaillotement du cadavre ou sur les dimensions d'un contenant). Les données sont en centimètres.
   "connexions" TEXT, -- Indiquer si les connexions ostéo-articulaires sont dans l'ensemble conservées, moyennement conservées ou non conservées. 
   "migration_dehors" INTEGER, -- 0 ou 1. Indiquer, par oui ou non, si des os sont sortis du volume originel du cadavre (c'est un argument pour une décomposition au sein d'un contenant large). 
   "equil_instab" INTEGER, -- 0 ou 1.Indiquer si au moins un os repose en équilibre instable (dans le cas d'une décomposition au sein d'un contenant, il y a très rarement des os en équilibre instable). 
   "ouv_corolle" INTEGER, -- 0 ou 1. Indiquer si le grill costal s'est ouvert en corolle (necessaire pour argumenter une décomposition dans un espace vide).
   "pied_d_hypext" INTEGER, -- 0 ou 1. Indiquer si la position des os du pied droit traduise un effet d'hyperextension au moment du dépôt du cadavre
   "pied_g_hypext" INTEGER, -- 0 ou 1. Indiquer si la position des os du pied gauche traduise un effet d'hyperextension au moment du dépôt du cadavre
   "pied_d_hypflex" INTEGER, -- 0 ou 1. Indiquer si la position des os du pied droit traduise un effet d'hyperflexion au moment du dépôt du cadavre.
   "pied_g_hypflex" INTEGER, -- 0 ou 1. Indiquer si la position des os du pied gauche traduise un effet d'hyperflexion au moment du dépôt du cadavre.
   "pied_superpos" INTEGER, -- 0 ou 1. Indiquer si les os d'un pied repose sur ceux de l'autre pied (peu importe desquels il s'agit).
   "type_decompo" TEXT, -- liste de valeurs. Grâce à tous les éléments taphonomiques, indiquer si le défunt s'est décomposé au sein d'un espace colmaté rapidement (rapide), d'un espace laissant le sédiment s'infiltrer progressivement (progressif), d'un espace empêchant le sédiment de sceller les relations ostéo-articulaires (différé) ou si le manque d'osbervations ne permet pas de répondre quant à la vitesse du colmatage. 
   "compression" TEXT, -- liste de valeurs. Indiquer si les os traduisent un effet de compression au niveau de la ceinture scapulaire (épaule), des os coxaux (bassin) et/ou des pieds. 
   "linceul" INTEGER, -- 0 ou 1. A partir des éléments de compression, des épingles de linceul, de la distinction entre le contenant et l'emmaillotement, indiquer si le sujet était enveloppé d'un drap funéraire au moment du dépôt.
   "chaussure" INTEGER, -- 0 ou 1. A partir des indices taphonomiques et de la présence de clous au niveaux des os des pieds, indiquer si le défunt portait des chaussures au moment du dépôt. 
   "stad_conserv" TEXT, -- de 1 à 5. Indiquer le stade de conservation osseuse du sujet (cette partie ne traite que de la qualité osseuse et non de la quantité selon les classifications de Bello 2003). 
   "crane_face_apparit" TEXT, -- Indiquer la face d'apparition de la tête osseuse.
   "ceint_scap_d" TEXT, -- Indiquer la face d'apparition de la ceinture scapulaire droite.
   "ceint_scap_g" TEXT, -- Indiquer la face d'apparition de la ceinture scapulaire gauche.
   "m_sup_d" TEXT, -- Indiquer la face d'apparition du membre supérieur droit.
   "m_sup_g" TEXT, -- Indiquer la face d'apparition du membre supérieur gauche.
   "rachis" TEXT, -- Indiquer la face d'apparition du rachis.
   "ceint_pelv" TEXT, -- Indiquer la face d'apparition de la ceinture pelvienne.
   "m_inf_d" TEXT, -- Indiquer la face d'apparition du membre inférieur droit.
   "m_inf_g" TEXT, -- Indiquer la face d'apparition du membre inférieur gauche.
   "comment_sep_prim" TEXT -- commentaire spécifique au caractère "primaire" du dépôt du squelette dans la sépulture.
);

-- la table consernant les OBSERVATIONS réalisées dans le cas d'un SEPULTURE SECONDAIRE
