   "poids" REAL, -- Indiquer le poids de l'objet
   "long" REAL, -- Indiquer la longeur de l'objet
   "larg" REAL, -- Indiquer la largeur de l'objet
   "epaiss" REAL -- Indiquer l'épaisseur de l'objet
