-- le contenant de la sep
DROP TABLE IF EXISTS t_cont_sep;
CREATE TABLE t_cont_sep(
   "id_cont_sep" INTEGER PRIMARY KEY,
   "num_cont_sep" INTEGER UNIQUE,
   "num_us_sep" INTEGER, -- numero de la sepulture/us, clé étrangère qui renvoie à la table t_us_sep
   "type_cont" TEXT,
   "matiere" TEXT,
   "calag_ext" INTEGER, -- 0 ou 1
   "comment_calag" TEXT,
   "clous" INTEGER, -- Indiquer le nombre de clous retrouvé à la fouille 
   "long_tot_ext" REAL, -- Indiquer la longueur totale externe du contenant (prendre la partie la mieux conservée ou, par défaut, le centre du contenant) 
   "long_tot_int" REAL, -- Indiquer la longeur totale interne (sans prendre en compte les parois)
   "larg_tete_ext" REAL, -- Indiquer la largeur externe de la paroi de tête
   "larg_tete_int" REAL, -- Indiquer la largeur interne au niveau de la paroi de tête (sans prendre en compte les parois)
   "larg_pied_ext" REAL, -- Indiquer la largeur externe de la paroi de pied
   "larg_pied_int" REAL, -- Indiquer la largeur interne au niveau de la paroi de pied (sans prendre en compte les parois)
   "ht_paroi_max" REAL, -- Indiquer la plus grande hauteur du contenant (retenir la paroi la mieux conservée)
   "ep_paroi_tete" REAL, -- Indiquer l'épaisseur de la paroi de tête au niveau où elle est le mieux conservée
   "ep_paroi_pied" REAL, -- Indiquer l'épaisseur de la paroi de pied au niveau où elle est le mieux conservée
   "ep_paroi_lat_d" REAL, -- Indiquer l'épaisseur de la paroi latérale droite au niveau où elle est le mieux conservée
   "ep_paroi_lat_g" REAL, -- Indiquer l'épaisseur de la paroi latérale gauche au niveau où elle est le mieux conservée
   "ep_fond" REAL, -- Indiquer l'épaisseur du fond au niveau où elle est le lieux conservée
   "ind_trapez_int" REAL, -- ("larg_tete_int"/"larg_pied_int")*100. Il s'agit d'un indice trapézoïdal calculé automatiquement. Il prend en compte les dimensions extérieures du contenant.
   "enduit_liss" INTEGER, -- 0 ou 1. SI sarcophage en plâtre (champs "type_cont" et "matiere"). Indiquer s'il y a un enduit de lissage.
   "ep_enduit_liss" REAL, -- SI sarcophage en plâtre (champs "type_cont" et "matiere"). Indiquer l'épaisseur de l'enduit de lissage qui a été appliqué sur le fond du contenant.
   "cal_moul_int" INTEGER, -- 0 ou 1. SI sarcophage en plâtre (champs "type_cont" et "matiere"). Indiquer s'il y a un élément qui aurait servi à caler le moule interne, uniquement dans la cas d'un sarcophage en plâtre ou une structure maçonnée.
   "mat_moul_int" TEXT, -- Lste de Valeurs. SI sarcophage en plâtre (champs "type_cont" et "matiere"). Indiquer le matériau utilisée pour le calage.
   "nb_coul" INTEGER, -- SI sarcophage en plâtre (champs "type_cont" et "matiere"). Indiquer le nombre de coulée(s) observée(s) (elles sont souvent identifiables en donnant un coup de masse sur la paroi).
   "nb_plch_int" INTEGER, -- SI sarcophage en plâtre (champs "type_cont" et "matiere"). Indiquer le nombre de planches minimum qui ont été utilisés pour la réalisation du moule interne.
   "nb_plch_ext" INTEGER, -- SI sarcophage en plâtre (champs "type_cont" et "matiere"). Indiquer le nombre de planches minimum qui ont été utilisés pour la réalisation du moule externe.
   "trou_evac" INTEGER, -- 0 ou 1. SI sarcophage en plâtre (champs "type_cont" et "matiere"). Indiquer s'il y a un trou d'évacuation.
   "decor" INTEGER, -- 0 ou 1. SI sarcophage en plâtre (champs "type_cont" et "matiere"). Indiquer s'il y a, au minimu, un décor.
   "descrip_decor" TEXT, -- SI sarcophage en plâtre (champs "type_cont" et "matiere"). Indiquer de quel(s) décor(s) il s'agit et sa position.
   "couvercl" INTEGER, -- 0 ou 1. SI sarcophage en plâtre (champs "type_cont" et "matiere"). Indiquer s'il y a un couvercle.
   "comment" TEXT -- Description libre.
);

